import axios from "axios";

import AppSidebar from "../../../Components/Sidebars/AppSidebar";
import AppTopbar from "../../../Components/Topbars/AppTopbar"

import CampaignSidebar from "../../../Components/Sidebars/CampaignSidebar"
import SingleCampaignNavbar from "../../../Components/CampaignComponents/SingleCampaignNavbar";
import CampaignAdd from "../../../Components/CampaignComponents/CampaignProspects/CampaignAdd"

import {GlobalContext} from "../../../GlobalProvider"
import { useContext, useState, useEffect } from "react";
import Cookies from "universal-cookie";

const cookies = new Cookies()
function SingleCampaignProspects() {
  const [prospects, setProspects] = useState([])
  const {addProspect, newProspect, upload, addProspectCampaign} = useContext(GlobalContext)
  const [campaignProspectAdd, setCampaignProspectAdd] = addProspectCampaign
  const {id} = useParams()

  useEffect(() => {
    getProspects()
  }, [])

  const getProspects = async () => {
    const params = {
      campaignId: id
    }
    await axios.get(`/prospects/prospect/campaign`, {
      headers: {
        "Authorization": `Bearer ${cookies.get('access_token')}`,
      },
      params: params
    }).then((res) => {
      if(res.data === ""){
        console.log("Data Null")
      }
      else{
        console.log(res.data)
        setProspects(res.data)
      }
    })
  }

  return(
    <div className="single-campaign">
      {campaignProspectAdd===true ? <CampaignProspectAdd/> : console.log('null')}
      <Sidebar/>
      <Topbar title={"Campaign"}/>
      <div className="single-campaign__container">
          <div className="single-campaign__container--sidebar">
            <CampaignsSidebar/>
          </div>
          <div className="single-campaign__container--content">
            <SingleCampaignNavbar/>
            <div className="single-campaign__container--content--prospects u-margin-top-medium">
              <div className="toolbar">
                <div className="name">
                  <h4>My Prospects</h4>
                </div>
                <div className="search">
                  <input type="search" placeholder="Search"/>
                </div>
              </div>

            <div className="table__container">
              <table className="data">
                <thead>
                  <tr className="row1">
                    <th className="col-head">Prospect</th>
                    <th className="col-head">Contact</th>
                    <th className="col-head">Company</th>
                    <th className="col-head">List</th>
                    <th className="col-head">Tags</th>
                    <th className="col-head">Status</th>
                  </tr>
                </thead>

                <tbody>
                  {prospects.map(d => 
                    <tr key={d.id}>
                      <td><p className="col-data">{d.firstName} {d.lastName}</p></td>
                      <td><p className="col-data">
                            {d.prospectLinkedinUrl}
                            {d.prospectMobileNumber}
                            {d.prospectEmail}
                      </p></td>
                      <td><p className="col-data">{d.prospectCompany}</p></td>
                      <td><p className="col-data">Campaign 1</p></td>
                      <td><p className="col-data">-</p></td>
                      <td><p className="col-data">Not Contacted</p></td>
                    </tr>
                  )}
                </tbody>
              </table>
            </div>
            </div>
          </div>
      </div>
    </div>
  )
}

export default SingleCampaignProspects;
